import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
;


export default class Tour extends Component {
    render() {
        return <div>
            <section className="img vid-section" style={{ backgroundImage: "url(../assets/images/bg_2.jpg)" }}>
                <div className="overlay"></div>
                <div className="container-xl">
                    <div className="row justify-content-center">
                        <div className="col-md-10 vid-height d-flex align-items-center justify-content-center text-center">
                            <div className="video-wrap" data-aos="fade-up">
                                <span className="subheading">Watch our luxurious hotel</span>
                                <h3>Take A Tour</h3>
                                <NavLink to="https://vimeo.com/115041822" className="video-icon glightbox d-flex align-items-center justify-content-center">
                                    <span className="ion-ios-play"></span>
                                </NavLink>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </div>;
    }
}
